import "../Style/App.css";
import React from "react";
import ReactDOM from "react-dom";
import { Admin, Resource } from "react-admin";

function Header() {
  return (
    <header>
      <Admin dataProvider={dataProvider} customRoutes={customRoutes}></Admin>
    </header>
  );
}

export default Header;
